TABLEATTRIBUTE.VALUE:
UPDATE IN_ETL_CONTROL
SET TXT_KEY_VALUE=
  (SELECT LPAD(TO_CHAR(COUNT(*)),10,'0')
  FROM IN_ST_PREMCSCNT
  WHERE txt_file_name='$$STR_CONTROL_FILE_NAME'
   ),
  DTE_UPDATE_DATE   =SYSDATE
WHERE TXT_KEY_STRING='PREMCSCNT_PRESTAGE_RECORD_COUNT'
AND txt_file_name   ='$$STR_CONTROL_FILE_NAME';

COMMIT;
